import React from 'react';
import '../../App.css';
import Footer from '../Footer';

export default function Services() {
  return (
    <>
      <div class="container">
        <img src="nature.jpg" alt="Norway" style="width:100%;">
          <div class="text-block">
            <h4>Nature</h4>
            <p>What a beautiful sunrise</p>
          </div>
          </img>
      </div>
    </>
  );
}
